  func.func public @main(%arg0: tensor<8xf32>, %arg1: tensor<8xf32>) -> (tensor<8xf32> {jax.result_info = "result"}) {
    %0 = stablehlo.maximum %arg0, %arg1 : tensor<8xf32>
    %1 = stablehlo.minimum %0, %arg1 : tensor<8xf32>
    %cst = stablehlo.constant dense<1.000000e-01> : tensor<f32>
    %2 = stablehlo.broadcast_in_dim %cst, dims = [] : (tensor<f32>) -> tensor<8xf32>
    %3 = stablehlo.add %arg1, %2 : tensor<8xf32>
    %4 = stablehlo.divide %1, %3 : tensor<8xf32>
    %5 = stablehlo.subtract %4, %arg1 : tensor<8xf32>
    return %5 : tensor<8xf32>
  }
}
